import React, { useRef, useState, useEffect } from "react";
import "./FeaturedCars.css";

/**
 * FeaturedCars
 * - Two-way pill: "Best buys for you" / "Newly added" (50:50)
 * - Horizontal scrollable/swipable cards using scroll-snap
 * - On tab change the list updates and scrolls to start
 */

const BEST = [
  { id: "b1", title: "2020 Maruti Baleno", trim: "Zeta", price: "₹5.46 Lakh", km: "33,500 km", img: process.env.PUBLIC_URL + "/car1.png" },
  { id: "b2", title: "2019 Hyundai i20", trim: "Asta", price: "₹6.10 Lakh", km: "28,000 km", img: process.env.PUBLIC_URL + "/car2.png" },
  { id: "b3", title: "2018 Honda City", trim: "VX", price: "₹8.25 Lakh", km: "40,200 km", img: process.env.PUBLIC_URL + "/car3.png" },
];

const NEWLY = [
  { id: "n1", title: "2023 Tata Nexon", trim: "XZA", price: "₹9.20 Lakh", km: "6,500 km", img: process.env.PUBLIC_URL + "/car4.png" },
  { id: "n2", title: "2023 Kia Seltos", trim: "HTX", price: "₹14.0 Lakh", km: "3,200 km", img: process.env.PUBLIC_URL + "/car5.png" },
  { id: "n3", title: "2022 Toyota Glanza", trim: "G", price: "₹7.2 Lakh", km: "12,000 km", img: process.env.PUBLIC_URL + "/car6.png" },
];

export default function FeaturedCars() {
  const [mode, setMode] = useState("best"); // "best" | "new"
  const trackRef = useRef(null);

  const items = mode === "best" ? BEST : NEWLY;

  // scroll to start when changing dataset
  useEffect(() => {
    const node = trackRef.current;
    if (!node) return;
    node.scrollTo({ left: 0, behavior: "smooth" });
  }, [mode]);

  return (
    <section className="fc-section">
      <h2 className="fc-title">Featured Spinny cars</h2>

      <div className="fc-pill" role="tablist" aria-label="Featured filter">
        <button
          role="tab"
          aria-selected={mode === "best"}
          className={`fc-pill-btn ${mode === "best" ? "active" : ""}`}
          onClick={() => setMode("best")}
        >
          Best buys for you
        </button>

        <button
          role="tab"
          aria-selected={mode === "new"}
          className={`fc-pill-btn ${mode === "new" ? "active" : ""}`}
          onClick={() => setMode("new")}
        >
          Newly added
        </button>
      </div>

      <div className="fc-carousel-wrap">
        <div
          className="fc-track"
          ref={trackRef}
          // allow keyboard scroll for accessibility
          tabIndex={0}
          aria-label="Featured cars carousel"
        >
          {items.map((c) => (
            <article key={c.id} className="fc-card">
              <div className="fc-card-media" style={{ backgroundImage: `url(${c.img})` }} />
              <div className="fc-card-body">
                <div className="fc-card-row">
                  <div className="fc-card-title">{c.title}</div>
                  <div className="fc-card-price">{c.price}</div>
                </div>

                <div className="fc-card-sub">{c.trim}</div>

                <div className="fc-card-tags">
                  <span className="fc-tag">{c.km}</span>
                  <span className="fc-tag">Petrol</span>
                  <span className="fc-tag">Manual</span>
                  <span className="fc-tag">DL3C</span>
                </div>

                <div className="fc-card-footer">
                  <span className="fc-hub">HUB · Gaur City Mall, Noida</span>
                  <span className="fc-assured">Assured</span>
                </div>
              </div>
            </article>
          ))}
        </div>
      </div>

      <div style={{ textAlign: "center", marginTop: 18 }}>
        <button className="fc-viewall">View all Spinny cars</button>
      </div>
    </section>
  );
}
